{"source": ["Taylor Swift"], "date": ["2019-06-01 06:14:51"], "text": "ğŸŒˆHAPPY PRIDE MONTH!!!ğŸŒˆ While we have so much to celebrate, we also have a great distance to go before everyone in this country is truly treated equally. In excellent recent news, the House has passed the Equality Act, which would protect LGBTQ people from discrimination in their places of work, homes, schools, and other public accommodations. The next step is that the bill will go before the Senate. Iâ€™ve decided to kick off Pride Month by writing a letter to one of my senators to explain how strongly I feel that the Equality Act should be passed. I urge you to write to your senators too. Iâ€™ll be looking for your letters by searching the hashtag #lettertomysenator. While thereâ€™s no information yet as to when the Equality Act will go before the Senate for a vote, we do know this: Politicians need votes to stay in office. Votes come from the people. Pressure from massive amounts of people is a major way to push politicians towards positive change. Thatâ€™s why Iâ€™ve created a petition at taylorswift.lnk.to/petition to urge the Senate to support the Equality Act.  Our countryâ€™s lack of protection for its own citizens ensures that LGBTQ people must live in fear that their lives could be turned upside down by an employer or landlord who is homophobic or transphobic. The fact that, legally, some people are completely at the mercy of the hatred and bigotry of others is disgusting and unacceptable. Letâ€™s show our pride by demanding that, on a national level, our laws truly treat all of our citizens equally. ğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆğŸŒˆ", "reactions": "74K", "likes": "39K", "ahah": "160", "love": "33K", "wow": "887", "sigh": "61", "grrr": "152", "post_id": "10156533697610369", "url": "/story.php?story_fbid=10156533697610369&id=19614945368"}
